PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(80) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id"), "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id"), UNIQUE ("group_id", "permission_id"));
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id"), "group_id" integer NOT NULL REFERENCES "auth_group" ("id"), UNIQUE ("user_id", "group_id"));
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id"), "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id"), UNIQUE ("user_id", "permission_id"));
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "action_time" datetime NOT NULL, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id"), "user_id" integer NOT NULL REFERENCES "auth_user" ("id"));
CREATE TABLE IF NOT EXISTS "alchimest_port" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(128) NOT NULL, "container_port" varchar(128) NOT NULL, "protocol" varchar(20) NOT NULL, "component_id" char(32) NOT NULL REFERENCES "alchimest_component" ("commit_id"));
CREATE TABLE IF NOT EXISTS "alchimest_volume" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "pvc_name" varchar(128) NOT NULL, "container_path" varchar(128) NOT NULL, "requests_storage_G" real NOT NULL, "mode" varchar(20) NOT NULL, "type" varchar(20) NOT NULL, "component_id" char(32) NOT NULL REFERENCES "alchimest_component" ("commit_id"));
CREATE TABLE IF NOT EXISTS "alchimest_namespace" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(256) NOT NULL, UNIQUE ("name"));
CREATE TABLE IF NOT EXISTS "alchimest_employee_own_namespaces" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "employee_id" integer NOT NULL REFERENCES "alchimest_employee" ("id"), "namespace_id" integer NOT NULL REFERENCES "alchimest_namespace" ("id"), UNIQUE ("employee_id", "namespace_id"));
CREATE TABLE IF NOT EXISTS "alchimest_employee" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "job" varchar(40) NOT NULL, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id"));
CREATE TABLE IF NOT EXISTS "alchimest_componentrelease" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer NOT NULL, "description" varchar(256) NULL, "examined" bool NOT NULL, "component_id" char(32) NOT NULL REFERENCES "alchimest_component" ("commit_id"), "in_package_id" char(32) NOT NULL REFERENCES "alchimest_package" ("commit_id"));
CREATE TABLE IF NOT EXISTS "alchimest_affinity" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "type" varchar(20) NOT NULL, "reason" varchar(256) NULL, "component_id" char(32) NOT NULL REFERENCES "alchimest_component" ("commit_id"), "to_component_id" char(32) NOT NULL REFERENCES "alchimest_component" ("commit_id"));
CREATE TABLE IF NOT EXISTS "alchimest_image" ("commit_id" char(32) NOT NULL PRIMARY KEY, "name" varchar(256) NOT NULL, "tag" varchar(50) NOT NULL, "latest" bool NOT NULL, "changed_from" char(32) NULL, "registry" varchar(256) NOT NULL, "version" varchar(128) NOT NULL, "namespace_id" integer NOT NULL REFERENCES "alchimest_namespace" ("id"), UNIQUE ("name", "namespace_id", "tag"));
CREATE TABLE IF NOT EXISTS "alchimest_environment" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(256) NOT NULL, "value" varchar(256) NOT NULL, "component_id" char(32) NOT NULL REFERENCES "alchimest_component" ("commit_id"), "type" varchar(50) NOT NULL);
CREATE TABLE IF NOT EXISTS "alchimest_component" ("commit_id" char(32) NOT NULL PRIMARY KEY, "name" varchar(256) NOT NULL, "tag" varchar(50) NOT NULL, "latest" bool NOT NULL, "changed_from" char(32) NULL, "description" varchar(256) NULL, "host_network" bool NOT NULL, "mem_per_instance" real NOT NULL, "cpu_per_instance" real NOT NULL, "image_id" char(32) NOT NULL REFERENCES "alchimest_image" ("commit_id"), "namespace_id" integer NOT NULL REFERENCES "alchimest_namespace" ("id"), UNIQUE ("name", "namespace_id", "tag"));
CREATE TABLE IF NOT EXISTS "alchimest_package" ("commit_id" char(32) NOT NULL PRIMARY KEY, "name" varchar(256) NOT NULL, "tag" varchar(50) NOT NULL, "latest" bool NOT NULL, "changed_from" char(32) NULL, "description" varchar(256) NULL, "approved" bool NOT NULL, "namespace_id" integer NOT NULL REFERENCES "alchimest_namespace" ("id"), UNIQUE ("name", "namespace_id", "tag"));
CREATE TABLE IF NOT EXISTS "alchimest_universallyuniquevariableincomponent" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "in_component_id" char(32) NOT NULL REFERENCES "alchimest_component" ("commit_id"), "uuv_id" char(32) NOT NULL REFERENCES "alchimest_universallyuniquevariable" ("id"));
CREATE TABLE IF NOT EXISTS "alchimest_universallyuniquevariableinpackage" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "in_package_id" char(32) NOT NULL REFERENCES "alchimest_package" ("commit_id"), "uuv_id" char(32) NOT NULL REFERENCES "alchimest_universallyuniquevariable" ("id"));
CREATE TABLE IF NOT EXISTS "alchimest_replica" ("id" char(32) NOT NULL PRIMARY KEY, "time" datetime NOT NULL, "user_id" integer NOT NULL REFERENCES "auth_user" ("id"), "data_file" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "alchimest_universallyuniquevariable" ("id" char(32) NOT NULL PRIMARY KEY, "key" varchar(512) NOT NULL, "value_type" varchar(50) NOT NULL, "value_origin" varchar(50) NOT NULL, "value" varchar(512) NULL, "description" varchar(512) NULL, UNIQUE ("key"));
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL, UNIQUE ("app_label", "model"));
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id"), "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL, UNIQUE ("content_type_id", "codename"));
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "is_superuser" bool NOT NULL, "username" varchar(30) NOT NULL UNIQUE, "first_name" varchar(30) NOT NULL, "last_name" varchar(30) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "last_login" datetime NULL);
CREATE TABLE IF NOT EXISTS "coil_alchimesthook" ("url" varchar(512) NOT NULL PRIMARY KEY);
CREATE TABLE IF NOT EXISTS "coil_furionhook" ("url" varchar(512) NOT NULL PRIMARY KEY);
CREATE TABLE IF NOT EXISTS "coil_deploymentrecord" ("id" char(32) NOT NULL PRIMARY KEY, "package_name" varchar(256) NOT NULL, "package_namespace" varchar(256) NOT NULL, "package_tag" varchar(50) NOT NULL, "environment_name" varchar(50) NOT NULL, "is_success" bool NOT NULL, "time" datetime NOT NULL, "user_id" integer NOT NULL REFERENCES "auth_user" ("id"), "result" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "dashboard_userdashboardmodule" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(255) NOT NULL, "module" varchar(255) NOT NULL, "app_label" varchar(255) NULL, "user" integer unsigned NOT NULL, "column" integer unsigned NOT NULL, "order" integer NOT NULL, "settings" text NOT NULL, "children" text NOT NULL, "collapsed" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "furion_partnervariable" ("key" varchar(512) NOT NULL PRIMARY KEY, "description" varchar(512) NULL);
CREATE TABLE IF NOT EXISTS "furion_partnervariableinenvironment" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "is_secret" bool NOT NULL, "value" varchar(512) NULL, "checked" bool NOT NULL, "in_environment_id" varchar(50) NOT NULL REFERENCES "furion_environment" ("name"), "partner_variable_id" varchar(512) NOT NULL REFERENCES "furion_partnervariable" ("key"));
CREATE TABLE IF NOT EXISTS "furion_region" ("name" varchar(50) NOT NULL PRIMARY KEY, "k8s_api_endpoint" varchar(128) NOT NULL, "auth_token" varchar(512) NOT NULL);
CREATE TABLE IF NOT EXISTS "furion_service" ("name" varchar(50) NOT NULL PRIMARY KEY, "type" varchar(20) NOT NULL);
CREATE TABLE IF NOT EXISTS "furion_useservice" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "exclusive" bool NOT NULL, "in_environment_id" varchar(50) NOT NULL REFERENCES "furion_environment" ("name"), "service_id" varchar(50) NOT NULL REFERENCES "furion_service" ("name"));
CREATE TABLE IF NOT EXISTS "furion_variable" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(256) NOT NULL, "type" varchar(50) NOT NULL, "value" varchar(256) NOT NULL, "in_service_id" varchar(50) NOT NULL REFERENCES "furion_service" ("name"));
CREATE TABLE IF NOT EXISTS "furion_environment" ("name" varchar(50) NOT NULL PRIMARY KEY, "region_id" varchar(50) NULL REFERENCES "furion_region" ("name"));
CREATE TABLE IF NOT EXISTS "jet_bookmark" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "url" varchar(200) NOT NULL, "title" varchar(255) NOT NULL, "user" integer unsigned NOT NULL, "date_add" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "jet_pinnedapplication" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(255) NOT NULL, "user" integer unsigned NOT NULL, "date_add" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "phoenix_data" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content" text NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
